import React from "react";
import bootstrap from "bootstrap";

const Home = () => {
  return (
    <div className="home_page">
      <p id="three_words">Creator, Innovator, Hard Worker</p>
      <p>
        Seeking to join a driven team to help in their endeavors and build a
        better future together.
      </p>
      <p id="quote">The best way to predict the future is to create it.</p>
      <p id="quote">- Peter Drucker</p>

      <div class="container border">
        <div class="row">
          <div class="col-md-4">col 1</div>
          <div class="col-md-5">col 2</div>
        </div>
      </div>
    </div>
  );
};

export default Home;
